import Container from 'react-bootstrap/Container';
import Nav from 'react-bootstrap/Nav';
import Navbar from 'react-bootstrap/Navbar';
import NavDropdown from 'react-bootstrap/NavDropdown';
import "./navBar.css"

const Header = () => {
  return (
    <Navbar expand="lg" className="background"> 
      <Container>
        <Navbar.Brand href="#home" className='logo-text'><span id='get'>get</span><span id='linked'>linked</span></Navbar.Brand>

          <Nav className="me-auto">
            <Nav.Link href="#home">Timeline</Nav.Link>
            <Nav.Link href="#link">Overview</Nav.Link>
            <Nav.Link href="#home">FQAs</Nav.Link>
            <Nav.Link href="#link">Contact</Nav.Link>
          </Nav>
      </Container>
    </Navbar>
  );
}

export default Header;
